CREATE FUNCTION refresh_question_ts_data() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
	qid INTEGER;
	count INTEGER := 0;
begin
	FOR qid IN SELECT * FROM "FormBuilder".question LOOP
